  `ORG_IN_NO` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '归属信息-商户归属接入机构',
  `PAY_PSWD` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '支付密码信息-支付密码密文：支付密码加密后的密文,以HEX字符串存储',
  `ERR_PPSW_DT` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '支付密码信息-支付密码错误日期',
