  `PAY_PSWD_STS` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '支付密码信息-支付密码状态: 0-正常，1-锁定，2-初始化',
