  `RSV_2` varchar(512) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '基础信息-预留字段2,字段的含义视具体项目的情况而定。',
  `RSV_3` varchar(512) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '基础信息-预留字段3,字段的含义视具体项目的情况而定。',
