  `LONGI_TUDE` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '经度',
  PRIMARY KEY (`MERC_ID`, `MSHP_ID`) USING BTREE,
  UNIQUE INDEX `T_URM_MSHP_PK`(`MERC_ID`, `MSHP_ID`) USING BTREE,
  INDEX `T_URM_MSHP_NI1`(`MERC_ID`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '商户门店信息表' ROW_FORMAT = Dynamic;

