  `TM_SMP` varchar(26) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '时间戳',
  `REQ_BUS_NO` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '流水号',
  `SYS_CNL` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '系统渠道',
  `BUS_CNL` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '业务渠道',
  `RESERVD` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '预留字段',
  `CRD_STS` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '卡状态 N:正常',
  `CRD_ASC` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '卡组织\r\nCUP-银联卡\r\nVISA-visa卡\r\nMC-MasterCard卡',
  PRIMARY KEY (`USR_NO`, `CAP_CRD_NO_CIPHER`, `CRD_BND_TYP`) USING BTREE,
  UNIQUE INDEX `T_URM_PCRDBIND_PK`(`USR_NO`, `CAP_CRD_NO_CIPHER`, `CRD_BND_TYP`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '用户银行卡总信息表' ROW_FORMAT = Dynamic;

